package projectp1;

public class Swap {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 10;
		int b = 20;
		System.out.println("Values before Swapping is "+a+" "+b);
		int temp = a;
		a = b;
		b = temp;
		System.out.println("Values after Swapping is "+a+" "+b);

	}

}
